<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">

    <title>欢迎!</title>
    <style>
        * {
            margin: 0;
            padding: 0;
        }

        body {
            background-color: #fff;
            position: relative;
            font-family: 'kaiti', "Helvetica Neue", monospace, "Monaco" !important;
            word-spacing: 1px !important;
            letter-spacing: 1px !important;
        }

        div.bg {
            z-index: -10;
            height: 100vh;
            width: 100%;
            position: fixed;
            background-repeat: no-repeat;
            background-size: cover;
            background-position: center;
            background-attachment: fixed;
            transition: background-image ease-in-out 1s;
        }

        div.container {
            margin: 0 100px 0 100px;
            position: relative;
            height: 100vh;
        }

        .title {
            padding-top: 100px;
            font-family: 'fangsong';
            display: block;
            position: relative;
            font-size: 50px;
            height: 60px;
            min-height: 60px;
            color: rgb(245, 245, 245);
        }

        .title::after {
            content: ' ';
            position: absolute;
            width: 3px;
            height: 60px;
            min-height: 60px;
            background-color: #fff;
            animation: stepAni 0.5s steps(1) infinite;
        }

        @keyframes stepAni {

            0%,
            100% {
                background-color: #fff;
            }

            50% {
                background-color: transparent;
            }
        }


        .list {
            margin-top: 30px;
            list-style-type: none;
            transition: width linear 0.5s;
           
        }

        .list .item {
            margin: 10px;
            box-sizing: border-box;
            border-radius: 5px;
            width: 100px;
            height: 50px;
            cursor: pointer;
            display: inline-flex;
            justify-content: center;
            align-items: center;
            background: rgba(0, 0, 0, 0.3);
            box-shadow: 1px 1px 2px rgba(0, 0, 0, 0.5), -1px -1px 2px rgba(0, 0, 0, 0.3);
            transition: transform  ease-in-out 0.2s,scale  ease-in-out 0.1s;
        }

        .list .item:hover {
            box-shadow: 2px 2px 4px rgba(0, 0, 0, 0.8), -1px -1px 2px rgba(0, 0, 0, 0.4);
            transform: translateY(-5px) scale(1.1);
        }

        .link {
            color: #fff !important;
        }

        .link:hover {
            color: rgb(98, 98, 228) !important;
        }

        .link:visited {
            color: rgb(58, 58, 211) !important;
        }

        footer {
            position: fixed;
            bottom: 20px;
            width: 100%;
            display: flex;
            justify-content: center;
        }
        footer a {
            display: block;
        }

        footer a:hover {
            color: #ddd;
        }

        footer a img {
           transition: transform ease-in-out 0.2s;
        }

        footer a img:hover {
           transform: scale(1.2);
        }


        @media screen and (max-width: 500px) {
            body {
                width: 100%;
            }

            div.container {
                 margin: 0 ;
            }

            .title {
                padding-top: 130px;
                font-size: 2rem;
                height: 2rem;
                min-height:  2rem;
            }

            .title::after {
                width: 3px;
                height:  2rem;
                min-height:  2rem;
                background-color: #fff;
            }


            .list {
                display: block;
                margin-top: 100px;
            }


            .list .item {
                width: 100px !important;
                padding: 0;
                font-size: 1rem;
                height: 36px !important;

            }
        }
    </style>
</head>

    <script>
        let links = [

            {
                href: 'https://wuxin0011.github.io/blog/',
                text: '博客',
                title: '前往我的博客',
            },
            {
                href: 'https://github.com/wuxin0011/wuxin-blog',
                text: '博客源码',
                title: '前往我的博客源码',
            },
            {
                href: 'https://greasyfork.org/zh-CN/scripts/449261-%E7%9B%B4%E6%92%AD%E6%8F%92%E4%BB%B6',
                text: '直播插件',
                title: '前往直播插件'
            },
        ]
        const ul = document.querySelector('ul.list')

        if (ul) {

            for (let i = 0; i < links.length; i++) {
                const data = links[i];
                const li = document.createElement('li')
                const span = document.createElement('span')
                span.className = 'link'
                li.className = 'item'
                li.title = data.title
                span.textContent = data.text
                li.addEventListener('click', () => {
                    window.open(data.href, "_blank")
                })
                li.appendChild(span)
                ul.appendChild(li)
            }
        }

    </script>

    <!-- 打字机展示区域 -->
    <script>
        const text = document.querySelector('header .title');
        const txt = ["不积跬步无以至千里,", "不积小流无以成江海.", "致敬努力的你!"];
        var index = 0;
        var xiaBiao = 0;
        var huan = true;
        setInterval(function () {
            if (huan) {
                text.innerHTML = txt[xiaBiao].slice(0, ++index);
            }
            else {
                text.innerHTML = txt[xiaBiao].slice(0, index--);
            }

            if (index == txt[xiaBiao].length + 3) {
                huan = false;
            }
            else if (index < 0) {
                index = 0;
                huan = true;
                xiaBiao++;
                if (xiaBiao >= txt.length) {
                    xiaBiao = 0;
                }
            }

        }, 200)

    </script>
